Empresas Contratadas.Descrição -1:
Instalação e Montagem - Sistemas Ventilação e Exaustão Mecâ-nica Serviço de manutenção de coifa exaustora para fogões industriais com exaustores incluindo:
-Descarbonização geral da coifa e retiradas das vigias dos dutos para limpeza;
-Limpeza e descarbonização dos Filtros;
-Limpeza de calhas de gorduras;
-Limpeza das entradas e saídas dos dutos;
-Limpeza do exaustor com descarbonização;
-Descarbonização externa dos dutos;
-Limpeza externa dos granitos do prédio 1° e 2°andar e
-Verificação de fuga de ar.

